import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";
import ListGroup from "react-bootstrap/ListGroup";

const cardStyle = {
    margin: "8px auto",
    width: '18rem',
    textColor: "black",
    textAlign: "center",
};

function TruckCard() {
    return (
            <Card style={cardStyle}>
                <Card.Img variant="top" src="https://s1.1zoom.ru/big0/187/302174-Berserker.jpg" />
                <Card.Body>
                    <Card.Title>Freightliner Truck</Card.Title>
                </Card.Body>
                <ListGroup className="list-group-flush">
                    <ListGroup.Item>Объём: 16м<sup>3</sup></ListGroup.Item>
                    <ListGroup.Item>Стоимость: 50 000$</ListGroup.Item>

                    <Button variant="primary" style={{alignContent: "center"}}>Выбрать</Button>
                </ListGroup>
            </Card>
    );
}

export default TruckCard;
